@here we ask all validators to update

we have seen issues with miners timing out and seeing 0 incentives because the cut-off to respond is 30 sec with this PR we have increased it to 120 sec solving a majority of the timeouts we saw 
https://github.com/neuralinternet/compute-subnet/pull/60

@neural-internet・27 FOR MINING / VALIDATING USE LOCAL SUBTENSOR NOT FINNEY

many have seen issues when using Finney and moving the wallet to a new machine, this causes signature mismatch issues

here is a guide for setting up local subtensor using Flux https://help.runonflux.io/docs/host-a-bittensor-full-node-via-the-flux-cloud/

